#include "PDBDataDesc.h"

PDBDataDesc::PDBDataDesc(IPDBMsgObject* pObject, const sequence_number_t sequenceNumber)
: IDataDesc(IDataDesc::eType::DATA_TYPE_PDB)
, m_pdbObject(pObject)
, m_sequenceNumber(sequenceNumber)
{
  __DEV_CALLSTACK_FUNC__;
}

bool PDBDataDesc::init(IPDBMsgObject* pObject, const sequence_number_t sequenceNumber)
{
  __DEV_CALLSTACK_FUNC__;
  m_pdbObject = pObject;
  m_sequenceNumber = sequenceNumber;
  return true;
}
